      image1.addEventListener("load", () => {
        ctx.drawImage(image1, 0, 0, canvas.width, canvas.height);
        const scanImage = ctx.getImageData(0, 0, canvas.width, canvas.height);
        const scanData = scanImage.data;
        for (let i = 0; i < scanData.length; i += 4) {
          const total = scanData[i] + scanData[i + 1] + scanData[i + 2];
          const avg = total / 3;
          scanData[i] = avg;
          scanData[i + 1] = avg + 10;
          scanData[i + 2] = avg;
        }
        scanImage.data = scanData;
        ctx.putImageData(scanImage, 0, 0);
      });
